import React from 'react'
import RenderPerson from './RenderPerson'


const ViewPersons = (props) => {
    console.log(props.persons, props.filter)
    const filteredNames = props.persons.filter(person => person.name.includes(props.value))

    return (
        filteredNames.map((person) =>
            <RenderPerson
                key={person.id}
                person={person}
                handleRemove={props.handleRemove}
            />
        )
    )
}



export default ViewPersons
